<div role="note" class="hatnote navigation-not-searchable">此條目關於7月1日有關反對逃犯條例修訂草案的衝突。其前奏見<a href="/wiki/2019%E5%B9%B46%E6%9C%889%E6%97%A5%E9%A6%99%E6%B8%AF%E5%8F%8D%E5%B0%8D%E9%80%83%E7%8A%AF%E6%A2%9D%E4%BE%8B%E4%BF%AE%E8%A8%82%E8%8D%89%E6%A1%88%E9%81%8A%E8%A1%8C" title="2019年6月9日香港反對逃犯條例修訂草案遊行">6月9日遊行</a>、<a href="/wiki/%E5%8F%8D%E5%B0%8D%E9%80%83%E7%8A%AF%E6%A2%9D%E4%BE%8B%E4%BF%AE%E8%A8%82%E8%8D%89%E6%A1%88%E4%BD%94%E9%A0%98%E8%A1%8C%E5%8B%95" class="mw-redirect" title="反對逃犯條例修訂草案佔領行動">6月12日佔領</a>、<a href="/wiki/2019%E5%B9%B46%E6%9C%8816%E6%97%A5%E5%8F%8D%E5%B0%8D%E9%80%83%E7%8A%AF%E6%A2%9D%E4%BE%8B%E4%BF%AE%E8%A8%82%E8%8D%89%E6%A1%88%E9%81%8A%E8%A1%8C" class="mw-redirect" title="2019年6月16日反對逃犯條例修訂草案遊行">6月16日遊行</a>、<a href="/wiki/%E9%A6%99%E6%B8%AF%E5%AD%B8%E7%95%8C%E5%8F%8D%E5%B0%8D%E9%80%83%E7%8A%AF%E6%A2%9D%E4%BE%8B%E4%BF%AE%E8%A8%82%E8%8D%89%E6%A1%88%E5%9C%8D%E5%A0%B5%E8%A1%8C%E5%8B%95" title="香港學界反對逃犯條例修訂草案圍堵行動">6月21日圍堵行政機關與警察總部</a>，後續見<a href="/wiki/2019%E5%B9%B47%E6%9C%887%E6%97%A5%E5%8F%8D%E5%B0%8D%E9%80%83%E7%8A%AF%E6%A2%9D%E4%BE%8B%E4%BF%AE%E8%A8%82%E8%8D%89%E6%A1%88%E9%81%8A%E8%A1%8C" class="mw-redirect" title="2019年7月7日反對逃犯條例修訂草案遊行">7月7日遊行</a>。關於整場社會運動，見<b><a href="/wiki/%E5%8F%8D%E5%B0%8D%E9%80%83%E7%8A%AF%E6%A2%9D%E4%BE%8B%E4%BF%AE%E8%A8%82%E8%8D%89%E6%A1%88%E9%81%8B%E5%8B%95" title="反對逃犯條例修訂草案運動">反對逃犯條例修訂草案運動</a></b>。</div>
